class Test extends Component
{
   //The componentDidMount() method runs or fires off after the component output has been rendered to the DOM.
    
    componentDidMount()
    {
        console.log('Component did mount');
    }
    render()
    {
        return(<div>
            <h1>Test Component</h1>
            </div>
              )
            
        
    }
}

export default Test;
